import requests
import json
import os
b = ""
# Replace with your actual API key
AZURE_API_KEY = '' 

url = "https://experiments-muhammed.services.ai.azure.com/providers/mistral/azure/ocr"

headers = {
    "Content-Type": "application/json",
    "Authorization": f"Bearer {AZURE_API_KEY}"
}

payload = {
    "model": "mistral-document-ai-2505",
    "document": {
        "type": "document_url",
        "document_url": f"data:application/pdf;base64,{b}"
    },
    "document_annotation_format": {
        "type": "json_schema",
        "json_schema": {
            "schema": {
                "properties": {
                    "ABN": {"title": "ABN", "type": "string"},
                    "items": {"title": "items", "type": "array", "items": {"type": "string"}},
                    "invoice_number": {"title": "invoice_number", "type": "string"}
                },
                "required": ["ABN", "items", "invoice_number"],
                "title": "DocumentAnnotation",
                "type": "object",
                "additionalProperties": False
            },
            "name": "document_annotation",
            "strict": True
        }
    },
    "include_image_base64": True
}

response = requests.post(url, headers=headers, json=payload)

# Print raw response or parsed JSON
try:
    print(json.dumps(response.json(), indent=2))
except Exception:
    print(response.text)
